import React from 'react';
import { Draggable } from 'react-beautiful-dnd';
const ImageComponent = ({photoId, image, handlePhotoOnClick}) => {
  return (
    <Draggable draggableId={`imageContainer${photoId}`} index={photoId}>
      {provided => (
        <div
          {...provided.draggableProps}
          {...provided.dragHandleProps}
          innerRef={provided.innerRef}
          className={`imageContainer ${image.class}`}
          onClick={() => handlePhotoOnClick(image.id)}
          id={`imageContainer${photoId}`}
        >
          <img
            className='photo'
            src={image.url}
            alt={photoId}
          />
        </div>
      )}
    </Draggable>
  )
}

export default ImageComponent;
